import React from 'react'
import perfect  from '../assets/perfect.png';
import  search from '../assets/search.png';
import share  from '../assets/share.png';
import styled from 'styled-components';


const Conatiner=styled.div`
    width:100%
    height: 250vh;
    background-color: white;
}`;

const Left=styled.div`
    width:50%;
    margin:10px;
    padding:25px;
    h1{
        font-size:2rem;
        font-weight:600;
    }
    p{
        font-size:1.5rem;
        margin-left:15px;
    }

`;

const Right= styled.div`
width:50%;
margin:10px;
padding:25px;
img{
    padding-right:0;
    margin-right:0;
    right:0;
}
h1{
    font-size:2rem;
    font-weight:600;
}
p{
    font-size:1.5rem;
    margin-right:15px;
}

`;

const Row=styled.div`
    justify-between:space-between;
    display:flex;
    align-items:center;
    max-width:1100px;
    padding:30px;
    margin-left:40px;
`;

const Howitworks = () => {
    return (
        <>
        <Conatiner >
            <Row>
                <Left><h1>Struck Ups, Facing issues Need Help?</h1>
                        <p>The right place is here, Search here for right person.</p>
                </Left>
                <Right><img src={search}></img></Right>
            </Row>
        </Conatiner>
    </>
        )
}

export default Howitworks
